function comput(line){
    var stack = [];
    for (var i=0;i<line.length; i++){
        //console.log(line[i]);
        var c = line[i];
        if(c==='{' || c==='[' || c==='('){
            stack.push(c);
        }
        if(c==='}' || c===']' || c===')'){
            var poped = stack.pop();

            // console.log(poped);

            if( (c==='}' && poped!=='{')  ||  (c===')' && poped!=='(')  ||  (c===']' && poped!=='[')){
                console.log('NO');
                break;
            }

            else if( i === line.length-1 && stack.length===0){

                console.log('YES');
                //break;

            }
        }

    }

}



